    border: 2px solid #545969;
    border-radius: 4px;
    background-color: #2d3038;
    width: max-content;

    .search {
      background-color: #2d3038;
      padding: 15px 10px;
    }

    .country {
      &:hover {
        background-color: #c7cbd333 !important;
      }

      .dial-code {
        color: #c7cbd3;
      }
    }

    .country.highlight {
      background-color: #c7cbd333 !important;
    }
  }
}

